import 'package:flutter/material.dart';
import 'package:tts06c1/reuseable_gridcontainer.dart';

class GridScreen extends StatefulWidget {
  const GridScreen({super.key});

  @override
  State<GridScreen> createState() => _GridScreenState();
}

class _GridScreenState extends State<GridScreen> {
  List containerImages = ["data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,"];

  @override
  Widget build(BuildContext context) {
    return Scaffold(
      appBar: AppBar(
        title: const Text("GridView Screen"),
      ),
      body: Container(
        margin: const EdgeInsets.symmetric(horizontal: 10,vertical: 10),
        child: GridView.count(crossAxisCount: 2,
        childAspectRatio: 160/250,
        crossAxisSpacing: 10,
        mainAxisSpacing: 10,
        children: List.generate(containerImages.length, (index) => GridContainer(
            name: "Mountain $index",
            price: "\$ $index",
            image: containerImages[index])),
        ),
      ),
    );
  }
}
